import Header from '../Header/index'
import Sections from '../Sections/index'
import './index.css'

function Home(){
    return(
        <div class="Header">
            <Header title="Esse é o título"/>
            <Sections title="Classificação de Imagem" />
            <Sections title="Detecção de Objetos" />
        </div>

    );
}

export default Home;
